description:
Ce jeu de données est issu de l'**édition 2025** du [panorama des dépenses de santé](https://drees.solidarites-sante.gouv.fr/publications-communique-de-presse-infographie-documents-de-reference/250930-Panorama-d%C3%A9penses-de-sant%C3%A9) présentant les résultats des comptes de la santé. 
Les comptes de la santé retracent les dépenses et analysent de façon détaillée la consommation finale de soins de santé en France et les financements correspondants, qu’ils relèvent de l’Assurance maladie, de l’État, des collectivités locales, des organismes complémentaires ou directement des ménages. Élaborés par la DREES, les comptes de la santé constituent l’un des satellites des comptes nationaux de l’Insee, dont ils adoptent la méthodologie. Ils servent également de base à l’élaboration des comptes de la santé présentés dans les instances internationales (système SHA de l’OCDE, d’Eurostat et de l’OMS) et permettent ainsi d’établir des comparaisons internationales sur des bases fiables et harmonisées.
**Précisions méthodologiques**
Les postes suivants ne contiennent pas de détails concernant les montants des organismes complémentaires et le reste à charge des ménages:
  * les soins de sages-femmes ;
  * les subdivisions des soins hospitaliers du secteur privé, y compris les cures thermales ;
  * les orthophonistes, orthoptistes, pédicure-podologues, psychologues et les autres auxiliaires (ergothérapeutes, psychomotriciens, diététiciens) ;
  * les VSL et ambulances ainsi que les taxis ;
  * les subdivisions de l’optique (lentilles, montures, verres) ;
  * les subdivisions des matériels, aliments et pansements (matériel chirurgical et appareils, masques, pansements et nutriments).
Les détails concernant la décomposition au sein des organismes complémentaires (entre mutuelles, institutions de prévoyance et entreprises d'assurances) ne sont disponibles que à partir de 2021. La décomposition pour les années antérieures sera publiée ultérieurement.

Les plans de prévention des risques naturels ont été institués par la loi du 2 février 1995 relative au renforcement de la protection de l'environnement. Ils constituent l'instrument essentiel de l'Etat en matière de prévention des risques. Leur objectif est le contrôle du développement de l'urbanisme et de l'occupation des sols dans les zones exposées à un risque.
Pour les PPR naturels, le code de l'environnement définit deux catégories de zones (L562-1) : les zones exposées aux risques et les zones qui ne sont pas directement exposées aux risques mais sur lesquelles des mesures peuvent être prévues pour éviter d'aggraver le risque.
En fonction du niveau d'aléa, chaque zone fait l'objet d'un règlement opposable. Les règlements distinguent généralement trois types de zones :
1- les « zones d'interdiction de construire », dites « zones rouges », lorsque le niveau d'aléa est fort et que la règle générale est l'interdiction de construire ;
2- les « zones soumises à prescriptions », dites « zones bleues », lorsque le niveau d'aléa est moyen et que les projets sont soumis à des prescriptions adaptées au type d'enjeu ;
3- les zones non directement exposées aux risques mais où des constructions, des ouvrages, des aménagements ou des exploitations agricoles, forestières, artisanales, commerciales ou industrielles pourraient aggraver des risques ou en provoquer de nouveaux, soumises à interdictions ou prescriptions (cf. article L562-1 du Code de l'environnement).

