### Remarque relative au géocodage  
Ce premier géocodage a été réalisé à partir de l'identifiant de parcelle cadastrale, par jointure avec le fichier des parcelles cadastrales. À ce stade, c'est le millésime du 1er juillet 2021 qui a été utilisé.
Plusieurs lignes n'ont pas pu être géocodées, car l'identifiant de parcelle n'est pas présent dans le millésime considéré. Cela peut provenir de deux raisons : soit il s'agit d'une commune qui ne dispose pas d'un cadastre vectoriel, soit la parcelle considérée a été remaniée, et il sera possible à moyen terme de lui affecter des coordonnées.
