Ces données correspondent aux suivis visuels des oiseaux menés par les LPO PACA & OCCITANIE et Aude Nature à proximité des radars ornithologiques déployés à la côte dans le cadre du lot 5 de MIGRALION en année 2 et 3 (2023, 2024). Deux radars sont déployés selon le protocole suivant : 
- un radar fixe sur le site de la Palissade en Camargue (suivi en continu pendant 3 ans);
- un second radar, mobile en 2023 et déplacé sur 7 sites côtiers dans le Golfe du Lion (Banyuls, Leucate, Sérignan, Frontignan, Grau du Roi, Cassis, Toulon), puis fixe en 2024 (réserve naturelle du Bagnas à Agde).
Le suivi visuel s’est décliné en deux protocoles : un suivi de la migration des oiseaux en mer, et un suivi des oiseaux en halte migratoire au niveau des sites de suivi radar.
Ce premier protocole a pour objectif d’acquérir des données d’oiseaux en migration active en mer, pour obtenir des informations qualitatives sur les espèces et leur comportement. Ce suivi permet d’avoir un aperçu des espèces capables de migrer en mer, de leur fréquence d’observation, et donc indirectement de leur participation aux flux enregistrés par radar. Ce protocole permet par ailleurs de compléter les données du lot 4 (Suivi par bateau) sur les migrateurs terrestres, mais aussi pour les oiseaux marins qui ne sont pas suivis par les radars à la côte.
Ce suivi a été réalisé depuis des sites en bord de mer situés au plus près de la localisation des points de suivi radar, et offrant une visibilité importante sur le large. Les observations étaient réalisées à l’oeil, aux jumelles et à la longue-vue, afin de détecter le maximum de migrateurs. Les zones scannées comprenaient le large et la bande côtière, et le suivi était réalisé du lever du soleil à 4 heures après.
Sont alors renseignés :
-la date, l'heure, l'observateur et les conditions météorologiques associées à la session d'observation;
-le nom de l'espèce, l'effectif par tranche horaire;
-les distances moyennes estimées depuis la côte;
-la (les) direction(s) principale(s) de déplacement;
-la (les) hauteurs(s) de vol moyenne(s);
-l'effectif maximum observé simultanément lors de l'ensemble de la matinée pour les non-migrateurs;
-la somme des effectifs observés pour les migrateurs.

Ces données recensent les propriétés des échos détectés par radar ornithologique dans le cadre du lot 4 de MIGRALION :
-site : Arcachon (44.7826°N, 1.1716°O)
-année 1 : 2023/2024
Les objectifs du lot 4 du programme MIGRATLANE sont d’étudier la migration des oiseaux sur de longues séries temporelles, à deux échelles spatiales : une échelle fine avec les radars ornithologiques, et une large échelle avec les radars météorologiques. 
Les radars ornithologiques déployés à la côte permettent d’acquérir des connaissances par groupe d’espèces et notamment des données : 
   - d’effectifs dans la zone couverte par les instruments ; 
   - de hauteurs, directions et vitesses de vol ; 
   - de densité de passage à travers l’aire d’étude, en fonction de l’heure du jour et de la nuit ; 
   - d’évolution saisonnière et nycthémérale de ces variables. 
Les données sont livrées sous deux formes : les échos et leurs propriétés, et leur traduction en flux (MTR pour Migration Traffic Rate).
Dans le cas présent des données d'échos, voici la description des champs :
echoID : Identifiant unique de l’écho ;
time_stamp : Heure d’acquisition ;
time_string : Date d’acquisition ;
dateSunset : Date et heure du coucher de soleil ;
dayOrNight : Caractères, indiquant si la détection a été effectuée de jour (‘day’) ou de nuit (‘night’), avec comme référence le civil twilight (le seuil correspond à l'altitude du soleil -6°) ;
height : Hauteur (m) ;
altitude_asl : Altitude par rapport au niveau de la mer (m) ;
class : Classe de la cible parmi "insect, large_passer (pour large passerine), small_passer (pour small passerine), passerine_type, wader_type, swift_type, unid_bird (pour unidentified bird), bird_flock" ;
class_probability : Valeur entre 0 et 1 représentant la probabilité associée à la classification de la cible (~indice de confiance) ;
mtr_factor_rf : Facteur MTR, facteur de correction appliqué en fonction de la taille standardisée de l’écho et du volume de détection attendu pour une altitude donnée ;
direction : Direction/cap de la cible (°) ;
speed : Vitesse de la cible (m/s) ;
wbf : Fréquence de battement d’ailes (Wing beat frequency) ;
wbf_cred : Indice de confiance lié à la fréquence de battement d’ailes ;
threshold : Seuil de détection (dB) ;
siteName : nom du site de suivi par radar ;
stc_level : Niveau de stc (dB), utilisé pour calculé les facteurs MTR; 
latitude : Position du radar -  latitude (°) 
longitude : Position du radar - longitude (°)

Ces données correspondent aux suivis visuels des oiseaux menés par les LPO PACA & OCCITANIE et Aude Nature à proximité des radars ornithologiques déployés à la côte dans le cadre du lot 5 de MIGRALION en année 2 et 3 (2023, 2024). Deux radars sont déployés selon le protocole suivant : 
- un radar fixe sur le site de la Palissade en Camargue (suivi en continu pendant 3 ans);
- un second radar, mobile en 2023 et déplacé sur 7 sites côtiers dans le Golfe du Lion (Banyuls, Leucate, Sérignan, Frontignan, Grau du Roi, Cassis, Toulon), puis fixe en 2024 (réserve naturelle du Bagnas à Agde).
Le suivi visuel s’est décliné en deux protocoles : un suivi de la migration des oiseaux en mer, et un suivi des oiseaux en halte migratoire au niveau des sites de suivi radar.
Ce second protocole de suivi des oiseaux en halte migratoire a été mis en oeuvre de la façon suivante: un parcours d’une heure autour des sites de suivi radar était effectué, avec réalisation d’un inventaire de toutes les espèces présentes pour pouvoir comparer les observations aux détections réalisées par le radar.
Sont alors renseignés :
-la date, l'heure, l'observateur et les conditions météorologiques associées à la session d'observation;
-le nom de l'espèce, et l'effectif estimé posé ou en vol;
-la somme des effectifs observés.

Les plans de prévention des risques (PPR) constituent l'instrument essentiel de l'État en matière de prévention des risques. Leur objectif est le contrôle du développement dans les zones exposées à un risque.
L'élaboration d'un plan de prévention des risques génère une série de données géographiques organisée en plusieurs jeux de données. Un même PPR peut comporter les jeux de données géographiques contenant les :
- principaux périmètres englobants du PPR ;
- zones réglementées du plan une fois approuvé . Les règlements des PPR distinguent généralement les « zones d'interdiction de construire », dites « zones rouges », lorsque le niveau d'aléa est fort et que la règle générale est l'interdiction de construire ; les « zones soumises à prescriptions », dites « zones bleues » lorsque le niveau d'aléa est moyen et que les projets sont soumis à des prescriptions adaptées au type d'enjeu et les zones non directement exposées aux risques mais soumises à interdictions ou prescriptions ;
- zones d'aléa représentées sur la carte des aléas ayant servi à l'analyse du risque par croisement avec les enjeux, précisant pour chaque zone le niveau des aléas auxquels elle est exposée ;
- enjeux qui sont les personnes, biens, activités et éléments de patrimoine culturel ou environnemental menacés par un aléa et susceptibles d'être affectés ou endommagés par celui-ci ;
- origines du risque c'est-à-dire l'entité du monde réel qui, par sa présence, représente un risque potentiel. Cette entité peut être caractérisée par un nom, une référence à un objet externe ou un objet géographique localisant l'entité réelle à l'origine du risque.
Chaque élément d'une même série de données PPRN est lié par l'identifiant GASPAR de format « ddd[PREF|DDT|DDTM|DREAL]AAAANNNN » (AAAA et NNNN correspondent à l'année de référence et au numéro d'ordre de la procédure PPR associée dans GASPAR) à un seul objet dans la table des documents PPRN décrite par la fiche de métadonnées N_DOCUMENT_PPRN.

Pour les PPR naturels, le code de l'environnement définit deux catégories de zones (L562-1) : les zones exposées aux risques et les zones qui ne sont pas directement exposées aux risques mais sur lesquelles des mesures peuvent être prévues pour éviter d'aggraver le risque.
En fonction du niveau d'aléa, chaque zone fait l'objet d'un règlement opposable. Les règlements distinguent généralement trois types de zones :
1- les « zones d'interdiction de construire », dites « zones rouges », lorsque le niveau d'aléa est fort et que la règle générale est l'interdiction de construire ;
2- les « zones soumises à prescriptions », dites « zones bleues », lorsque le niveau d'aléa est moyen et que les projets sont soumis à des prescriptions adaptées au type d'enjeu ;
3- les zones non directement exposées aux risques mais où des constructions, des ouvrages, des aménagements ou des exploitations agricoles, forestières, artisanales, commerciales ou industrielles pourraient aggraver des risques ou en provoquer de nouveaux, soumises à interdictions ou prescriptions (cf. article L562-1 du Code de l'environnement) . Cette dernière catégorie ne s'applique qu'aux PPR naturels.

Données créées dans le cadre du projet d'élaboration d'une stratégie opérationnelle de restauration des habitats côtiers, estuariens et marins  afin d'évaluer le gain écologique en milieu marin. 
L'approche pour évaluer le gain écologique se base sur la méthodologie développée en milieu terrestre (étude Pogéis), sur le principe que : le potentiel de gain écologique est plus élevé lorsque celui-ci se situe dans un contexte peu anthropisé et que celui-ci est bien connecté à des espaces naturels. 
Dans Pogéis et dans le cadre du rapport restauration pour les milieux terrestres : la cartographie de l’occupation des sols (OSO) est utilisée. 
Dans les milieux côtiers : un recensement des activités ou dégradations présentes via les cartographies existantes susceptibles d’exercer une pression physique sur les habitats est ici testé.
Nom des données :
1. us_atl_pnmpg_restau_synth_activite_202503_ofb_pol_2154
(inventaire de toutes les pressions capables de causer un impact sur les habitats, données spatialisées des zones d'activités maritimes)
2. us_atl_pnmpg_restau_qualite_ecologique_occup_sol_source_tab_v3
(inventaire de toutes les pressions capables de causer un impact sur les habitats et ajout des zones dites naturelles (sans activité))
3. us_atl_pnmpg_restau_qualite_ecologique_occup_sol_pol_2154_v3
(regroupement des activités selon le coefficient de dégradation)
