Données créées dans le cadre du projet d'élaboration d'une stratégie opérationnelle de restauration des habitats côtiers, estuariens et marins pour déterminer les groupes de types d'habitats (GTH) présents dans les secteurs dégradés identifiés sur le terrain.
Les GTH ciblées sont ceux de l'annexe 1 (écosystèmes terrestres, côtiers et d'eau douce) et de l'annexe 2 (écosystèmes marins) du règlement européen (Règlement (UE) 2024/1991 du Parlement européen et du Conseil du 24 juin 2024 relatif à la restauration de la nature et modifiant le règlement (UE) 2022/869 (Texte présentant de l'intérêt pour l'EEE)).
Nom de la donnée :
-	us_atl_pnmpg_restau_secteur_degrade_vs_hab_annexe2_pol_2154
La table attributaire est composée de 8 champs :
-	id : identifiant unique de la couche ; 
-	commune : commune du secteur dégradé ;
-	priorité : seule les données conservées (priorité 1) sont gardées pour l'étude des habitats ;
- 	cod_eunis : code eunis présent dans le secteur ;
- 	lib_eunis : libellé eunis présent dans le secteur ;
- 	rest_hab : habitats listés, ou non, dans l'annexe 2 du règlement européen ;
- 	rest_gth : détermination du GTH dans lequel se trouve l'habitats eunis ;
- 	surf_m2 : surface de l'habitat eunis présent dans le secteur.

Le Répertoire National des Élus (RNE) a pour finalité le suivi des titulaires d’un mandat électoral. Il est renseigné et tenu à jour par les préfectures et hauts commissariats et par les services du ministère de l'intérieur, notamment sur la base des éléments fournis par les élus lors de la phase d’enregistrement des candidatures.
Les données du RNE sont structurées par mandat. Ce jeu de données comprend douze fichiers :
1- les conseillers d'arrondissement ;  
2- les conseillers municipaux ;  
3- les conseillers communautaires ;  
4- les conseillers départementaux ;  
5- les conseillers régionaux ;  
6- les membres des assemblées des collectivités à statut particulier ;  
7- les représentants au Parlement européen ;  
8- les sénateurs ;  
9- les députés ;  
10- les maires ;  
11- les conseillers des Français de l'étranger ;  
12- les membres de l'Assemblée des Français de l'étranger.
Un élu qui dispose de plusieurs mandats figurera dans plusieurs fichiers. Un élu qui dispose de plusieurs fonctions apparaîtra plusieurs fois au sein du même fichier (exemple : un élu adjoint au maire et maire délégué apparaitra deux fois au sein du fichier des conseillers municipaux).
Les fichiers mis en ligne sont actualisés trimestriellement.
Les données relatives à la profession sont déclaratives. Le référentiel des codes professions correspond au référentiel de l'INSEE.
Les demandes de rectification doivent être adressées directement par courriel à la préfecture territorialement compétente (pref-rne-contact@nom[-du-departement.gouv.fr](http://-du-departement.gouv.fr/)). Aucune demande de rectification adressée sur la plateforme [www.data.gouv.fr](https://www.data.gouv.fr/) ne sera prise en compte. Les rectifications apportées dans le RNE ne seront pas reportées immédiatement sur la plate-forme [www.data.gouv.fr](https://www.data.gouv.fr/), mais seront prises en compte pour la publication suivante.
Mise à jour du 13/06/2025. Le séparateur utilisé dans les fichiers est le point-virgule.

